import React, { Component } from "react";
import { Navbar, NavbarBrand } from "react-bootstrap";
import { Nav } from "react-bootstrap";
import { NavDropdown } from "react-bootstrap";
import { Form } from "react-bootstrap";
import { FormControl } from "react-bootstrap";
import { Button } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faSearch } from "@fortawesome/free-solid-svg-icons";
import { faUser } from "@fortawesome/free-solid-svg-icons";
import "../index.css";
import NavbarToggle from "react-bootstrap/esm/NavbarToggle";

class NavBar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      'CompanyName': 'Navbar',
      'User_Log': 'Login'
    }
  }
  render() {
    return (
      <Navbar collapseOnSelect bg="light" expand="lg">
        <Navbar.Brand href="#"> {this.state.Na} </Navbar.Brand>
        <Form inline className="my-2">
          <FormControl type="text" placeholder="search" className="mr-sm-0" />
          <Button type="submit" className="btn btn-primary">
            <span>
              <FontAwesomeIcon icon={faSearch} />
            </span>
          </Button>
        </Form>
        <Navbar.Toggle aria-controls="basic-navabar-nav" />
        <Navbar.Collapse
          id="basic-navbar-nav"
          className="bas my-2 my-lg-0"
        >
          <Nav className="mr-sm-3" variant='outline-info'>
            <Nav.Item>
              <Nav.Link href="#">Login</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="#">Register</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="#">Notification</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="#">cart</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="#">Profile</Nav.Link>
            </Nav.Item>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }
}

export default NavBar;
